let profiles = [];

const profileDataString = localStorage.getItem('profileData');
if (profileDataString) {
  try {
    profiles = JSON.parse(profileDataString);
  } catch (error) {
    console.error('Error parsing profile data:', error);
  }
}

export default profiles;
